Giza hilketa edo homizidioa pertsona bat hiltzeko ekintza da. Adiera zabalean, giza hilketak gerran hiltzea, heriotza zigorra gauzatzean eta juridikoki hilketatzat jo ez diren gizakien heriotzak, zuzenean eragin ez direnak, barne hartzen ditu, egoerari buruz egiten den giza eta gizarte balorazioa zein den; zentzu juridikoan, baina, zigor zuzenbidean zigortzen den krimena da, zehazki definitzen dena. Ordenamendu juridikoa zein den, giza hilketa mota zenbait bereizten dira: 
* giza hilketa doloso edo borondatezkoa, non hiltzeko asmo garbia dagoen; horren baitan erailketa dago, besteak beste aldez aurretik pentsatu den giza hilketa dena; 
* nahi gabeko giza hilketa, hiltzeko aldez aurreko asmorik ez zegoenean, baina hiltzaileak gauzatutako ekintzaren ondorioetako bat hiltzea izan daitekeela jakin eta, hala ere, ekintza aurrera eramaten duelarik; 
* halabeharrezko giza hilketa, ekintza baten ondorioz heriotza gerta zitekeela aurreikus ezin daitekeenean edota hilketa guztiz halabeharrezkoa denean.
